import React from 'react'
import { useHistory } from 'react-router-dom'

const AskQuestion = () => {
    const user = 1;
    const history =useHistory()
    const redirect = () => {
        alert("login or signup to ask a question")
        history.push('/Auth')
    }
    return (
    <div>
        <>
        {
            user === null ?
            redirect():
            <div>

            </div>
        }
        </>
    </div>
  )
}

export default AskQuestion
